    result += y[9]*ums[9]*imw[9]; /*CH */
    result += y[10]*ums[10]*imw[10]; /*CH2 */
    result += y[11]*ums[11]*imw[11]; /*CH2(S) */
    result += y[12]*ums[12]*imw[12]; /*CH3 */
    result += y[13]*ums[13]*imw[13]; /*CH4 */
    result += y[14]*ums[14]*imw[14]; /*CO */
    result += y[15]*ums[15]*imw[15]; /*CO2 */
    result += y[16]*ums[16]*imw[16]; /*HCO */
    result += y[17]*ums[17]*imw[17]; /*CH2O */
    result += y[18]*ums[18]*imw[18]; /*CH2OH */
    result += y[19]*ums[19]*imw[19]; /*CH3O */
    result += y[20]*ums[20]*imw[20]; /*CH3OH */
    result += y[21]*ums[21]*imw[21]; /*C2H2 */
    result += y[22]*ums[22]*imw[22]; /*C2H3 */
    result += y[23]*ums[23]*imw[23]; /*C2H4 */
    result += y[24]*ums[24]*imw[24]; /*C2H5 */
    result += y[25]*ums[25]*imw[25]; /*C2H6 */
    result += y[26]*ums[26]*imw[26]; /*HCCO */
    result += y[27]*ums[27]*imw[27]; /*CH2CO */
    result += y[28]*ums[28]*imw[28]; /*CH2CHO */
    result += y[29]*ums[29]*imw[29]; /*N2 */
    result += y[30]*ums[30]*imw[30]; /*H3Op */
    result += y[31]*ums[31]*imw[31]; /*HCOp */
    result += y[32]*ums[32]*imw[32]; /*C2H3Op */
    result += y[33]*ums[33]*imw[33]; /*CH5Op */
    result += y[34]*ums[34]*imw[34]; /*OHn */
    result += y[35]*ums[35]*imw[35]; /*On */
    result += y[36]*ums[36]*imw[36]; /*O2n */
    result += y[37]*ums[37]*imw[37]; /*CO3n */
    result += y[38]*ums[38]*imw[38]; /*HCO3n */
    result += y[39]*ums[39]*imw[39]; /*E */

