    YOW += y[19]*imw[19]; /*CH3O */
    YOW += y[20]*imw[20]; /*CH3OH */
    YOW += y[21]*imw[21]; /*C2H2 */
    YOW += y[22]*imw[22]; /*C2H3 */
    YOW += y[23]*imw[23]; /*C2H4 */
    YOW += y[24]*imw[24]; /*C2H5 */
    YOW += y[25]*imw[25]; /*C2H6 */
    YOW += y[26]*imw[26]; /*HCCO */
    YOW += y[27]*imw[27]; /*CH2CO */
    YOW += y[28]*imw[28]; /*CH2CHO */
    YOW += y[29]*imw[29]; /*N2 */
    YOW += y[30]*imw[30]; /*H3Op */
    YOW += y[31]*imw[31]; /*HCOp */
    YOW += y[32]*imw[32]; /*C2H3Op */
    YOW += y[33]*imw[33]; /*CH5Op */
    YOW += y[34]*imw[34]; /*OHn */
    YOW += y[35]*imw[35]; /*On */
    YOW += y[36]*imw[36]; /*O2n */
    YOW += y[37]*imw[37]; /*CO3n */
    YOW += y[38]*imw[38]; /*HCO3n */
    YOW += y[39]*imw[39]; /*E */
    /*Now compute y to x conversion */
    x[0] = y[0]/(2.015940*YOW); 
    x[1] = y[1]/(1.007970*YOW); 
    x[2] = y[2]/(15.999400*YOW); 
    x[3] = y[3]/(31.998800*YOW); 
    x[4] = y[4]/(17.007370*YOW); 
    x[5] = y[5]/(18.015340*YOW); 
    x[6] = y[6]/(33.006770*YOW); 
    x[7] = y[7]/(34.014740*YOW); 
    x[8] = y[8]/(12.011150*YOW); 
    x[9] = y[9]/(13.019120*YOW); 
    x[10] = y[10]/(14.027090*YOW); 
    x[11] = y[11]/(14.027090*YOW); 
    x[12] = y[12]/(15.035060*YOW); 
    x[13] = y[13]/(16.043030*YOW); 
    x[14] = y[14]/(28.010550*YOW); 
    x[15] = y[15]/(44.009950*YOW); 
    x[16] = y[16]/(29.018520*YOW); 
    x[17] = y[17]/(30.026490*YOW); 
    x[18] = y[18]/(31.034460*YOW); 
    x[19] = y[19]/(31.034460*YOW); 
    x[20] = y[20]/(32.042430*YOW); 
    x[21] = y[21]/(26.038240*YOW); 
    x[22] = y[22]/(27.046210*YOW); 
    x[23] = y[23]/(28.054180*YOW); 
    x[24] = y[24]/(29.062150*YOW); 
    x[25] = y[25]/(30.070120*YOW); 
    x[26] = y[26]/(41.029670*YOW); 
    x[27] = y[27]/(42.037640*YOW); 
    x[28] = y[28]/(43.045610*YOW); 
    x[29] = y[29]/(28.013400*YOW); 
    x[30] = y[30]/(19.022761*YOW); 
    x[31] = y[31]/(29.017971*YOW); 
