    y[32] = c[32]*43.045061*CWinv; 
    y[33] = c[33]*33.049851*CWinv; 
    y[34] = c[34]*17.007919*CWinv; 
    y[35] = c[35]*15.999949*CWinv; 
    y[36] = c[36]*31.999349*CWinv; 
