    YOW += y[8]*imw[8]; /*C */
    YOW += y[9]*imw[9]; /*CH */
    YOW += y[10]*imw[10]; /*CH2 */
    YOW += y[11]*imw[11]; /*CH2(S) */
    YOW += y[12]*imw[12]; /*CH3 */
    YOW += y[13]*imw[13]; /*CH4 */
    YOW += y[14]*imw[14]; /*CO */
    YOW += y[15]*imw[15]; /*CO2 */
    YOW += y[16]*imw[16]; /*HCO */
    YOW += y[17]*imw[17]; /*CH2O */
    YOW += y[18]*imw[18]; /*CH2OH */
    YOW += y[19]*imw[19]; /*CH3O */
    YOW += y[20]*imw[20]; /*CH3OH */
    YOW += y[21]*imw[21]; /*C2H2 */
    YOW += y[22]*imw[22]; /*C2H3 */
    YOW += y[23]*imw[23]; /*C2H4 */
