    YOW += y[37]*imw[37]; /*CO3n */
    YOW += y[38]*imw[38]; /*HCO3n */
    YOW += y[39]*imw[39]; /*E */
    /*PW/RT (see Eq. 7) */
    PWORT = (*P)/(YOW * 8.31446261815324e+07 * (*T)); 
